import logo from "../../assets/"
import classes from "./Login.module.css"

const Login = () =>{
    return (
        <div className={classes.bigDiv}>
            <div> <img src={logo}></img></div>
            <div>Log In with Google</div>
        </div>
    )

}
export default Login
